<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>CrOSp3</title>

    <style>
        /* Global Styles */
* {
  font-family: "Inter", Arial, Helvetica, sans-serif;
  color: #f1f1f1;
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

body {
  background-color: #1e1e2e;
  margin: 0;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  min-height: 100vh;
  color: #f1f1f1;
  overflow-x:hidden;
}

/* Typography */
h1 {
  text-align: center;
  font-size: 3rem;
  margin-bottom: 20px;
  color: #00ff7b;
}

h2 {
  text-align: center;
  font-size: 2rem;
  color: #89ddff;
  padding-bottom: 15px;
}

label {
  display: block;
  margin-bottom: 5px;
  font-size: 1.2rem;
}

/* Links */
a {
  color: #82aaff;
  text-decoration: none;
  font-size: 1.2rem;
  transition: color 0.3s ease;
}

a:hover {
  color: #ffcb6b;
}

/* Inputs */
input {
  width: 100%;
  font-size: 1rem;
  padding: 10px;
  margin: 0px auto;
  display: block;
  border: 1px solid #44475a;
  border-radius: 5px;
  background-color: #282a36;
  color: #f8f8f2;
}

input::placeholder {
  color: #6272a4;
}

input:focus {
  outline: none;
  border-color: #ff79c6;
}

/* Buttons */
button,
input[type="submit"] {
  font-size: 1rem;
  padding: 10px 20px;
  margin: 10px auto;
  display: block;
  border: none;
  border-radius: 5px;
  background-color: #00ff7b;
  color: #ffffff;
  cursor: pointer;
  transition: background-color 0.3s ease;
}

button:hover,
input[type="submit"]:hover {
  background-color: #00ba5a;
}

/* Containers */
.container {
  width: 100%;
  max-width: 600px;
  margin: 20px auto;
  padding: 30px;
  background-color: #282a36;
  border-radius: 15px;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.3);
}

.redirect {
  width: 100%;
  max-width: 500px;
  margin: auto;
  background-color: #282a36;
  padding: 20px;
  border-radius: 15px;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.3);
  text-align: center;
}

.redirect > div {
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin: 15px 0;
}

.redirect > div > span {
  font-size: 1.5rem;
  color: #f1f1f1;
}

/* Miscellaneous */
.advertise {
  width: 100%;
  height: 50vh;
  border: none;
  border-radius: 15px;
  background-color: #1e1e2e;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.3);
}

.tall-boi {
  height: 100vh;
}

hr {
  border: 1px solid #44475a;
  margin: 20px 0;
}

/* Navigation */
nav {
  margin-bottom: 25px;
  position: sticky;
  top: 0;
  left: 0;
  width: 100%;
  background-color: #1e1e2e;
  padding: 15px 30px;
  display: flex;
  align-items: center;
  box-shadow: 0 2px 8px rgba(0, 0, 0, 0.2);
  z-index: 1000;
}

nav .logo {
  height: 50px;
  width: auto;
  margin-right: 20px;
  transition: transform 0.2s ease;
}

nav .logo:hover {
  transform: scale(1.05);
}

nav .navItem {
  color: #fff;
  font-family: "Roboto", sans-serif;
  font-size: 1.2rem;
  font-weight: 600;
  text-decoration: none;
  margin: 0px 10px;
  transition: color 0.3s ease, transform 0.2s ease;
}

nav .navItem:hover {
  color: #00ff7b;
  transform: scale(1.05);
}

/* Media Queries */
@media (max-width: 768px) {
  nav {
    padding: 10px 20px;
    flex-direction: column;
    text-align: center;
  }

  nav .logo {
    height: 40px;
    margin-bottom: 10px;
  }

  nav .navItem {
    margin: 10px 0;
    font-size: 1rem;
  }

  nav h1.navItem {
    font-size: 1.5rem;
  }
}

/* Recent Links */
.recentLinks {
  margin-top: 20px;
  display: flex;
  flex-direction: column;
}

.linkQrcode {
  width: 300px;
  height: 300px;
  display: block;
  margin: auto;
}

/* Error Page */
.error-container {
  width: fit-content;
  max-width: 1000px;
  margin: 20px auto;
  padding: 30px;
  background-color: #282a36;
  border-radius: 15px;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.3);
  text-align: center;
}

.error-message {
  display: flex;
  flex-direction: column;
  align-items: center;
}

.error-image {
  min-width: 900px;
  max-width: 950px;
  margin-bottom: 20px;
  max-height: 300px;
}

.error-code {
  font-size: 3.2rem;
  font-weight: bold;
  color: #ff6b6b;
  margin-bottom: 10px;
}

.error-description {
  font-size: 1.2rem;
  color: #ffffff;
  margin-bottom: 20px;
}

.return-home {
  font-size: 1.2rem;
  padding: 10px 20px;
  background-color: #00ff7b;
  color: #1e1e2e;
  border-radius: 5px;
  text-decoration: none;
  transition: background-color 0.3s ease;
}

.return-home:hover {
  background-color: #00ba5a;
}

#logs{
    width:80%;
    background-color: black;
    color: white;
    padding:20px;
    margin: auto;
    height:300px;
    overflow-y: scroll;
    white-space: pre-wrap;
}
    </style>
</head>
